problem:
What is the shortest distance that can be travelled if you start at any point, A, B, C, or D, and visit the other three points once?

[asy]
pair A,B,C, D;
A = (-3,3); B = (3,0); C = (0, -4); D = (0,0);
draw(D--B--C--cycle); draw(D--A--B--cycle);draw(D--A--C--cycle);
label("A", A, NW);label("B", B, E); label("C", C, S);label("D", D, NE);
label("3", D--B, S); label("6", A--B, NE); label("6", A--C, SW); label("4", D--C, NW+N);
label("5", A--D, SE+NE); label("5", C--B, E);
[/asy]

How many paths are there from A to B on the lines of the grid shown, if every step must be up or to the right?[asy]size(3cm,3cm);int w=6;int h=3;int i;for (i=0; i<h; ++i){ draw((0,i) -- (w-1,i));}for (i=0; i<w; ++i){ draw((i, 0)--(i,h-1));}label("B", (w-1,h-1), NE);label("A", (0,0), SW);[/asy]
For example, here is one such valid path highlighted in blue:
[asy]
size(3cm,3cm);
int w=6;
int h=3;
int i;
for (i=0; i<h; ++i){ 
draw((0,i) -- (w-1,i));
}for (i=0; i<w; ++i){ 
draw((i, 0)--(i,h-1));
}
label("B", (w-1,h-1), NE);
label("A", (0,0), SW);

draw((0,0)--(1,0), blue+1.5);
draw((1,0)--(1,1), blue+1.5);
draw((1,1)--(2,1), blue+1.5);
draw((2,1)--(3,1), blue+1.5);
draw((3,1)--(4,1), blue+1.5);
draw((4,1)--(4,2), blue+1.5);
draw((4,2)--(5,2), blue+1.5);
[/asy]

