int i, n;

for (i = -8; i <= 8; ++i) {
  draw((i,-8)--(i,8),gray(0.7));
  draw((-8,i)--(8,i),gray(0.7));
}

draw((-8,0)--(8,0),Arrows(6));
draw((0,-8)--(0,8),Arrows(6));

A = (-5,4);
B = (-1,3);
L = extension(A, B, (-8,0), (-8,1));
R = extension(A, B, (8,0), (8,1));

draw(L--R, red);

label("x", (8,0), E);
label("y", (0,8), N);
[/asy]

Below is the graph of y = a \sin (bx + c) for some positive constants a, b, and c.  Find a.

[asy]import TrigMacros;

size(300);

real f(real x)
{
	return 2*sin(4*x + pi/2);
}

draw(graph(f,-pi,pi,n=700,join=operator ..),red);
trig_axes(-pi,pi,-3,3,pi/2,1);
layer();
rm_trig_labels(-2,2, 2);

label("1", (0,1), E);
label("2", (0,2), E);
label("-1", (0,-1), E);
label("-2", (0,-2), E);
[/asy]

Line segment \overline{AB} is extended past A to P such that AP:PB = 1:4.  Then
\[\overrightarrow{P} = t \overrightarrow{A} + u \overrightarrow{B}\]for some constants t and u.  Enter the ordered pair (t,u).

[asy]
unitsize(1 cm);

pair A, B, P;

A = (0,0);
B = (5,1);
P = interp(A,B,-1/3);

draw(B--P);

dot("A", A, S);
dot("B", B, S);
dot("P", P, S);
[/asy]

There are two possible triangles with AB = 13, BC = 10, and A = 40^\circ.  One of them is shown below.  What is the sum of the two possible values of \angle B, in degrees?

[asy]
unitsize (1 cm);

pair A, B, C;

A = (0,0);
B = 5*dir(40);
C = (5,0);

draw(A--B--C--cycle);

label("A", A, SW);
label("B", B, N);
label("C", C, SE);
label("13", (A + B)/2, NW);
label("10", (B + C)/2, NE);
label("40^\circ", (1,0.4));
[/asy]
